{"query":"query {
        deliveryEstimates(
          productVariantId: "gid://shopify/ProductVariant/39614114726001"
        ) {
          options {
            deliveryPromisePresentmentTitle
            minDeliveryTime
            maxDeliveryTime
            minCalendarDaysToDelivery
            maxCalendarDaysToDelivery
            expiresAt
            cost {
              amount
            }
          }

          selectedShippingOption {
            deliveryPromisePresentmentTitle
            minDeliveryTime
            maxDeliveryTime
            minCalendarDaysToDelivery
            maxCalendarDaysToDelivery
            expiresAt
            reliableDateSource
            cost {
              amount
            }
            brandedPromise {
              name
              handle
              logo(theme: LIGHT) {
                src
                altText
              }
            }
            deliveryPromiseProviderAppId
          }

          deliveryAddress {
            zip
            city
            province
            provinceCode
            country
            countryCodeV2
            timezone
          }
